import React, { useRef, useState } from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
import 'swiper/css/navigation';
import './styles.css';
import { Navigation } from 'swiper/modules';
import { Container, Typography, Button } from '@mui/material';
import './App.css';
// Import Swiper styles
import 'swiper/swiper-bundle.min.css'; // Updated import for Swiper styles

export default function App() {
  const whiteTextStyle = {
    color: '#FFFFFF',
    textShadow: '1px 1px 2px black, 0 0 25px skyblue, 0 0 5px blue',
  };

  const openInNewTab = (url) => {
    const newWindow = window.open(url, '_blank', 'noopener,noreferrer');
    if (newWindow) newWindow.opener = null;
  };

  const handleClick = () => {
    openInNewTab('https://barbosapaoloromulus.web.app/');
  };

  return (
    <>
      <Swiper navigation={true} modules={[Navigation]} className="mySwiper">
        <SwiperSlide>Slide 1</SwiperSlide>
        <SwiperSlide>Slide 2</SwiperSlide>
        <SwiperSlide>Slide 3</SwiperSlide>
        <SwiperSlide>Slide 4</SwiperSlide>
        <SwiperSlide>Slide 5</SwiperSlide>
        <SwiperSlide>Slide 6</SwiperSlide>
        <SwiperSlide>Slide 7</SwiperSlide>
        <SwiperSlide>Slide 8</SwiperSlide>
        <SwiperSlide>Slide 9</SwiperSlide>
      </Swiper>

      <Container maxWidth="md" style={{ textAlign: 'center', marginTop: '100px' }}>
        <Typography variant="h3" gutterBottom style={whiteTextStyle}>
          WELCOME TO SEIJVAGE ARTWORKS
        </Typography>
        <Typography variant="h5" paragraph style={whiteTextStyle}>
          {/* Add your text content here */}
        </Typography>
        <Button variant="contained" color="primary" onClick={handleClick}>
          Check my Portfolio
        </Button>
      </Container>
    </>
  );
}
